import Modal from '../../../shared/Modal/Modal';

const StatusConfigurationModal = props => {
    const { isVisible, showModal } = props;

    return (
        <Modal isVisible={isVisible} title={'Confirm activation/deactivation'} showFooter showClose>
            <div> Are you sure to active/deactivate this configuration?</div>
        </Modal>
    );
};

StatusConfigurationModal.propTypes = {};

export default StatusConfigurationModal;
